import React, { Component } from 'react';
import './BinanceApi.scss'

const BinanceHistory = ({
  isBid,
  price,
  amount,
  }) => {
  return (
    <div className='bid-container'>
      {(isbid)}?
      <p className='bid-container__price'>{price}</p>
      <p className='bid-container__amount'>{amount}</p>:
      <p className='bid-container__price'>{price}</p>
    </div>
  );
}

export default BinanceHistory;
